sourcesContent:
import styled from 'styled-components';
export const Div0 = styled.div`
    width: 95%;
    margin-left: 2.5%;
    height: 30%;
    margin-top: 3%;
    float: left;
    background:red;

`
export const Div1 = styled.div`
    width: 30%;
    height: 70%;
    margin-left: 2.5%;
    margin-top: 2.5%;
    border: 2px solid #8E8E8E;
    border-radius: 10px;
    float: left;
    display: flex;
    justify-content: center;
    align-items: center;

`
